DELETE_VIDEO:{TITLE:"Comment supprimer une vid\u00e9o ?",TEXT:"Vous pouvez supprimer une vid\u00e9o en allant sur la page des les informations d'une vid\u00e9o et en cliquant sur G\u00e9rer les fichiers puis en s\u00e9lectionnant l'ic\u00f4ne de corbeille rouge. Cliquer sur Modifier un film et s\u00e9lectionner Supprimer le film est un autre moyen. Vous pouvez \u00e9galement utiliser le Gestionnaire de fichiers dans le menu G\u00e9rer le contenu. Vous pouvez voir tous les fichiers ajout\u00e9s ici. Cliquez sur l'ic\u00f4ne de corbeille rouge pour supprimer un fichier."},
VIDEO_FORMATS:{TITLE:"Quels formats vid\u00e9os sont support\u00e9s ?",TEXT:"Streama supporte actuellement seulement les formats vid\u00e9os support\u00e9s par le lecteur HTML5. Vous pouvez tester si votre fichier vid\u00e9o est compatible HTML5 en le glissant d\u00e9pla\u00e7ant dans un onglet vide de votre navigateur."},SUBTITLES:{TITLE:"Comment ajouter des sous-titres \u00e0 une vid\u00e9o ?",TEXT:"Vous pouvez ajouter des sous-titres aux vid\u00e9os en cliquant sur le bouton G\u00e9rer les fichiers situ\u00e9 dans la page d'information de la vid\u00e9o. Vous pouvez glisser d\u00e9placer les fichiers de sous-titres ici. Pr\u00e9cedemment, vous deviez les convertir dans un format compatible, mais ce n'est plus n\u00e9cessaire ! L'application s'en charge pour vous."},
INVITE_USERS:{TITLE:"Comment inviter un ami \u00e0 voir mes vid\u00e9os ?",TEXT:"Vous pouvez partager vos vid\u00e9os avec vos amis en les invitant sur votre Streama. Allez dans le menus Utilisateurs et cliquer sur le bouton Inviter un utilisateur. Remplissez le formulaire d'invitation et s\u00e9lectionner le/les r\u00f4le(s) de l'invit\u00e9. Les utilisateurs avec le r\u00f4le Administateur peuvent modifier les utilisateurs et les param\u00e8tres. Les utilisateurs avec le r\u00f4le Gestionnaire de contenu peuvent modifier le contenu. Votre ami sera notifi\u00e9 de l'invitation par email. Vous pouvez \u00e9galement partager une session vid\u00e9o avec vos amis en cliquant sur le bouton Partager sur le lecteur vid\u00e9o et en leur envoyant le lien vers la session."},
BASE_URL:{TITLE:"Quelle est l'URL racine et comment doit-je la configurer ?",TEXT:"L'URL racine est utilis\u00e9e pour les vid\u00e9os et les liens dans les e-mails d'invitation."},NOTIFICATIONS:{TITLE:"Que sont les notifications ?",TEXT:"Vous pouvez notifier vos amis \u00e0 propos de vid\u00e9os ajout\u00e9es en leur envoyant un message de notification. Vous pouvez les envoyer en les ajoutant dans votre liste de notification en cliquant sur le bouton Ajouter une notification sur la page d'information de la vid\u00e9o puis en allant dans le menu des notifications et en cliquant sur le bouton Envoyer la liste."},
