DELETE_VIDEO:{TITLE:"\u0643\u064a\u0641 \u064a\u0645\u0643\u0643\u0646\u064a \u062d\u0630\u0641 \u0641\u062f\u064a\u0648 \u061f",TEXT:"\u064a\u0645\u0643\u0646\u0643 \u062d\u0630\u0641 \u0645\u0642\u0637\u0639 \u0641\u064a\u062f\u064a\u0648 \u0628\u0627\u0644\u0627\u0646\u062a\u0642\u0627\u0644 \u0625\u0644\u0649 \u0635\u0641\u062d\u0629 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0627\u0644\u0641\u064a\u062f\u064a\u0648 \u0648\u0627\u0644\u0646\u0642\u0631 \u0639\u0644\u0649 \u0625\u062f\u0627\u0631\u0629 \u0627\u0644\u0645\u0644\u0641\u0627\u062a \u0648\u062a\u062d\u062f\u064a\u062f \u0631\u0645\u0632 \u0633\u0644\u0629 \u0627\u0644\u0645\u0647\u0645\u0644\u0627\u062a \u0627\u0644\u062d\u0645\u0631\u0627\u0621. \u0627\u0644\u0646\u0642\u0631 \u0639\u0644\u0649 \u062a\u0639\u062f\u064a\u0644 \u0627\u0644\u0641\u064a\u0644\u0645 \u0648\u062a\u062d\u062f\u064a\u062f\u0647 \u062d\u0630\u0641 \u0627\u0644\u0641\u064a\u0644\u0645 \u0647\u0648 \u0637\u0631\u064a\u0642\u0629 \u0623\u062e\u0631\u0649 \u0644\u0644\u0642\u064a\u0627\u0645 \u0628\u0630\u0644\u0643. \u064a\u0645\u0643\u0646\u0643 \u0623\u064a\u0636\u0627 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0625\u062f\u0627\u0631\u0629 \u0627\u0644\u0645\u0644\u0641\u0627\u062a \u0627\u0644\u0645\u0648\u062c\u0648\u062f\u0629 \u0641\u064a \u0642\u0627\u0626\u0645\u0629 \u0625\u062f\u0627\u0631\u0629 \u0627\u0644\u0645\u062d\u062a\u0648\u0649. \u064a\u0645\u0643\u0646\u0643 \u0645\u0634\u0627\u0647\u062f\u0629 \u062c\u0645\u064a\u0639 \u0627\u0644\u0645\u0644\u0641\u0627\u062a \u0627\u0644\u062a\u064a \u0642\u0645\u062a \u0628\u062a\u062d\u0645\u064a\u0644\u0647\u0627 \u0647\u0646\u0627\u0643. \u0627\u0646\u0642\u0631 \u064a\u0645\u0643\u0646 \u0631\u0645\u0632 \u0633\u0644\u0629 \u0627\u0644\u0645\u0647\u0645\u0644\u0627\u062a \u0627\u0644\u062d\u0645\u0631\u0627\u0621 \u0644\u062d\u0630\u0641 \u0645\u0644\u0641."},
