DELETE_VIDEO:{TITLE:"\ube44\ub514\uc624\ub97c \uc5b4\ub5bb\uac8c \uc0ad\uc81c \ud558\ub098\uc694?",TEXT:"\ube44\ub514\uc624 \uc815\ubcf4 \ud398\uc774\uc9c0 -> \ud30c\uc77c \uad00\ub9ac -> \ube68\uac04\uc0c9 \ud734\uc9c0\ud1b5 \uc544\uc774\ucf58 -> \uc601\ud654 \uc218\uc815 -> \uc120\ud0dd \uc601\ud654 \uc0ad\uc81c \ub97c \ud1b5\ud574 \uc0ad\uc81c \ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ucee8\ud150\uce20 \uad00\ub9ac \uba54\ub274\uc5d0 \uc788\ub294 \ud30c\uc77c \uad00\ub9ac\uc790\ub97c \uc0ac\uc6a9\ud574\uc11c \uc0ad\uc81c\ud560 \uc218\ub3c4 \uc788\uc2b5\ub2c8\ub2e4. \ud30c\uc77c \uad00\ub9ac\uc790\ub85c \uc5c5\ub85c\ub4dc\ud55c \uc601\uc0c1\ub4e4\uc744 \ubaa8\ub450 \ud655\uc778\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ube68\uac04 \ud734\uc9c0\ud1b5 \uc544\uc774\ucf58\uc744 \ud074\ub9ad\ud574\uc11c \uc0ad\uc81c\ud558\uc138\uc694."},
VIDEO_FORMATS:{TITLE:"\uc5b4\ub5a4 \ub3d9\uc601\uc0c1 \ud3ec\ub9f7\uc744 \uc9c0\uc6d0\ud558\ub098\uc694?",TEXT:"Streama\ub294 HTML5 \ud50c\ub808\uc774\uc5b4\uac00 \uc9c0\uc6d0\ud558\ub294 \ud615\uc2dd\uc758 \ub3d9\uc601\uc0c1 \ud3ec\ub9f7\ub9cc \uc9c0\uc6d0\ud569\ub2c8\ub2e4. \ube48 \ucc3d\uc5d0 \ub3d9\uc601\uc0c1\uc744 \ub4dc\ub798\uadf8 \uc564 \ub4dc\ub78d\uc744 \ud1b5\ud574 HTML5 \ud50c\ub808\uc774\uc5b4\uc640 \ud638\ud658\uc774 \ub418\ub294\uc9c0 \ud655\uc778\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4."},
SUBTITLES:{TITLE:"\uc790\ub9c9\uc744 \uc5b4\ub5bb\uac8c \ucd94\uac00 \ud560 \uc218 \uc788\ub098\uc694?",TEXT:"\ube44\ub514\uc624 \uc815\ubcf4 \ud398\uc774\uc9c0\uc5d0 \uc788\ub294 \ud30c\uc77c \uad00\ub9ac\uc790\ub97c \ud074\ub9ad\ud574\uc11c \ub3d9\uc601\uc0c1\uc5d0 \uc790\ub9c9\uc744 \ucd94\uac00\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ub4dc\ub798\uadf8 \uc564 \ub4dc\ub78d\uc744 \ud1b5\ud574\uc11c \ucd94\uac00\ud560 \uc218 \ub3c4 \uc788\uc2b5\ub2c8\ub2e4. \uc774\uc804\uc5d0\ub294 \uc218\ub3d9\uc73c\ub85c \ud30c\uc77c \ud615\uc2dd\uc744 \ud638\ud658 \uac00\ub2a5\ud55c \ud30c\uc77c \ud615\uc2dd\uc73c\ub85c \ubcc0\ud658\ud574\uc57c\ud588\uc9c0\ub9cc Streama\uac00 \ub300\uc2e0 \ud574\ub4dc\ub9bd\ub2c8\ub2e4!"},
INVITE_USERS:{TITLE:"\ub0b4\uac00 \ucd94\uac00\ud55c \ub3d9\uc601\uc0c1\uc744 \uce5c\uad6c\ub4e4\uc774 \ubcfc \uc218\uc788\ub3c4\ub85d \ud560 \uc218\uc788\ub098\uc694?",TEXT:" Streama\ub97c \ud1b5\ud574 \uce5c\uad6c\ub4e4\uc744 \ucd08\ub300\ud558\uc5ec \uce5c\uad6c\ub4e4\uc5d0\uac8c \ub3d9\uc601\uc0c1\uc744 \uacf5\uc720\ud560 \uc218\uc788\uc2b5\ub2c8\ub2e4. \uc720\uc800 \uba54\ub274\uc5d0\uc11c \uc720\uc800 \ucd08\ub300 \ubc84\ud2bc\uc744 \ud074\ub9ad\ud558\uc138\uc694. \ucd08\ub300 \ub9ac\uc2a4\ud2b8\ub97c \uc791\uc131\ud558\uace0 \ucd08\ub300\ud558\ub824\ub294 \uce5c\uad6c\uc758 \uad8c\ud55c\uc744 \uc124\uc815\ud558\uc138\uc694. \uad00\ub9ac\uc790 \uad8c\ud55c\uc744 \uac00\uc9c4 \uc720\uc800\ub294 \uc720\uc800 & \uc124\uc815\uc744 \ubcc0\uacbd\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ud30c\uc77c \uad00\ub9ac\uc790 \uad8c\ud55c\uc744 \uac00\uc9c4 \uc720\uc800\ub294 \ud30c\uc77c\uc744 \ubcc0\uacbd\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ucd08\ub300\uac00 \ub41c \uc774\ud6c4\uc5d0, \ub2f9\uc2e0\uc758 \uce5c\uad6c\ub4e4\uc5d0\uac8c \uc774\uba54\uc77c\ub85c \uc54c\ub78c\uc774 \uac11\ub2c8\ub2e4. \ube44\ub514\uc624 \ud50c\ub808\uc774\uc5b4\uc758 \uacf5\uc720 \ubc84\ud2bc\uc744 \ud074\ub9ad\ud55c \ud6c4, \ub9c1\ud06c\ub97c \uacf5\uc720\ud574\uc11c \uce5c\uad6c\ub4e4\uc5d0\uac8c \ub3d9\uc601\uc0c1\uc744 \uacf5\uc720\ud560 \uc218\ub3c4 \uc788\uc2b5\ub2c8\ub2e4."},
BASE_URL:{TITLE:"Base URL\uc774 \uc5b4\ub5a4 \uac83\uc774\uace0 \uc5b4\ub5bb\uac8c \uc124\uc815\ud560 \uc218 \uc788\ub098\uc694?",TEXT:"Base-URL \uc740 \ub3d9\uc601\uc0c1\uacfc \ucd08\ub300 \uc774\uba54\uc77c\uc758 \ub9c1\ud06c\ub85c \uc4f0\uc785\ub2c8\ub2e4."},NOTIFICATIONS:{TITLE:"\uc54c\ub78c\ub4e4\uc774 \ubb54\uac00\uc694?",TEXT:"\ucd08\ub300\ub41c \uce5c\uad6c\ub4e4\ud55c\ud14c \uc5c5\ub85c\ub4dc \ub41c \uc601\uc0c1\uc744 \uc54c\ub9b4 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ube44\ub514\uc624 \uc815\ubcf4 \ud398\uc774\uc9c0 -> \uc54c\ub78c -> \ub300\uae30\uc5f4 \uc804\uc1a1\uc744 \ud074\ub9ad \ud574\uc11c \uc54c\ub78c \ub300\uae30\uc5f4\uc5d0 \ucd94\uac00 \uc2dc\ud0ac \uc218 \uc788\uc2b5\ub2c8\ub2e4."},
