DELETE_VIDEO:{TITLE:"Hoe kan ik een video verwijderen?",TEXT:"U kan een video verwijderen door naar de infromatie pagina van de videos te gaan en op Manage Files te klikken. Daar klikt op het icoon van de rode vuilbak. Klikken op Edit Movie en Delete Movie selecteren is een tweede manier. Een derde manier is naar het Manage Content Menu te gaan en te klikken op het rode vuilbak icoon van het te verwijderen bestand."},VIDEO_FORMATS:{TITLE:"Welke video indelingen worden ondersteund?",TEXT:"Streama ondersteund momenteel enkel de video indelingen die ondersteund zijn door de HTML5 Player. U kan testen of uw video HTML5 compatibel is door uw bestand naar een leeg browsertablad te slepen."},
SUBTITLES:{TITLE:"Hoe kan ik ondertitels toevoegen aan videos?",TEXT:"U kan ondertitels toevoegen voor een bepaalde video door naar de informatiepagina van de video te gaan en de knop Manage Files in te drukken. U kan hier simpelweg ondertitel bestanden naartoe slepen. Voordien moest u de bestanden converteren naar een gekende bestandsindeling, maar niet langer! De applicatie zorgt hier nu volledig zelf voor."},INVITE_USERS:{TITLE:"Hoe kan ik vrienden uitnodigen om mijn gehoste video te bekijken?",
TEXT:"U kan uw videos delen met uw vrienden door ze uit te nodigen om uw Streama te gebruiken. Ga naar het Users Menu en klik op Invite User. Vul het uitnodigingsformulier in en selecteer de rol(len) van de genodigde. Gebuikers met de rol Admin kunnen gebruikers en instellen aanpassen. Gebruikers met de rol Content Manager kunnen materiaal beheren. Uw vriend zal op de hoogte gebracht worden van de uitnodiging via mail. U kan ook video sessies delen met vrienden door de Share-knop in te drukken tijdens het spelen van de video. De getoonde link kan u delen met hen."},
BASE_URL:{TITLE:"Wat is de basis URL en hoe moet ik deze configureren?",TEXT:"De basis URL wordt gebruikt voor de videos en de link in de invitatie email."},NOTIFICATIONS:{TITLE:"Wat zijn notificaties?",TEXT:"U kan uw uitgenodigde vrienden op de hoogte brengen van nieuw materiaal door hen notificaties te sturen. U kan deze sturen door ze toe te voegen aan de notificatierij. Dit door te klikken op Add Notification in de video's informatiepagina en naar het notificatiemenu te gaan en te klikken op Send Queue."},
