DELETE_VIDEO:{TITLE:"Como eu deleto um v\u00eddeo?",TEXT:"Voc\u00ea pode deletar um v\u00eddeo indo para a p\u00e1gina de informa\u00e7\u00e3o do v\u00eddeo e clicando em Gerenciar Conte\u00fado e clicando no bot\u00e3o vermelho de lixeira. Clicar em Edit Movie e ent\u00e3o em Delete Movie \u00e9 outro jeito de fazer isso. Voc\u00ea tamb\u00e9m pode usar o Gerenciador de Arquivos que fica no Gerenciador de Conte\u00fado. Voc\u00ea pode ver todos os arquivos que voc\u00ea enviou l\u00e1. Clique no bot\u00e3o da lixeira vermelha para deletar um arquivo."},
VIDEO_FORMATS:{TITLE:"Que formatos de v\u00eddeo s\u00e3o suportados?",TEXT:"O Streama atualmente suporta apenas formatos de v\u00eddeo suportados pelo player HTML5. Voc\u00ea pode testar se o seu arquivo de v\u00eddeo \u00e9 compat\u00edvel com o player HTML5 simplesmente arrastando e soltando seu arquivo numa nova aba do seu navegador."},SUBTITLES:{TITLE:"Como eu adiciono legendas para os v\u00eddeos?",TEXT:"Voc\u00ea pode adicionar legendas para os v\u00eddeos clicando no bot\u00e3o Gerenciar Arquivos, que fica na p\u00e1gina de informa\u00e7\u00f5es do v\u00eddeo. Voc\u00ea pode arrastar e soltar o arquivo das legendas l\u00e1. Antigamente voc\u00ea tinha que manualmente converter a legenda para um formato compat\u00edvel, mas n\u00e3o mais! Agora a aplica\u00e7\u00e3o converte para voc\u00ea."},
INVITE_USERS:{TITLE:"Como eu convido meus amigos para assistir meus v\u00eddeos hosteados?",TEXT:"Voc\u00ea pode compartilhar seus v\u00eddeos com seus amigos convidando eles para usar o seu Streama hosteado. V\u00e1 para o menu de Usu\u00e1rios e clique o bot\u00e3o Invite User. Preencha o formul\u00e1rio e selecione os cargos do convidado. Usu\u00e1rios com o cargo Admin podem editar Usu\u00e1rios & Configura\u00e7\u00f5es. Usu\u00e1rios com o cargo Content Manager podem editar conte\u00fado. Seu amigo ser\u00e1 notificado sobre o convite via email. Voc\u00ea tamb\u00e9m pode compartilhar sess\u00f5es de v\u00eddeo com seus amigos clicando no bot\u00e3o de Compartilhar dentro do player e mandando o link da sess\u00e3o para eles."},
BASE_URL:{TITLE:"O que \u00e9 a URL base e como eu devo configur\u00e1-la?",TEXT:"A URL base \u00e9 usada para v\u00eddeos e para o link no email de convite."},NOTIFICATIONS:{TITLE:"O que s\u00e3o notifica\u00e7\u00f5es?",TEXT:"Voc\u00ea pode notificar seus amigos que foram convidados sobre v\u00eddeos enviados mandando notifica\u00e7\u00f5es para eles. Voc\u00ea pode enviar notifica\u00e7\u00f5es adicionando eles a fila de notifica\u00e7\u00f5es ao clicar Adicione o bot\u00e3o Notifica\u00e7\u00e3o, que est\u00e1 na p\u00e1gina de informa\u00e7\u00f5es do seu v\u00eddeo, indo at\u00e9 o menu Notifica\u00e7\u00f5es e clicando no bot\u00e3o Enviar Fila."},
